import neptuneImg from "../../src/assets/img/monstersAvatars/Neptune.png";

const monsters = [
  {
    id: 1,
    name: "Neptune",
    life: 100,
    img: neptuneImg,
    attack: 21,
    speed: 1000,
    dodge: 0,
    accuracy: 0,
    armor: 0,
  },
];

export default monsters;
